    public function setZoom($zoom)
    {
        $this->_zoom = $zoom;
    }

    public function getZoom()
    {
        return $this->_zoom;
    }

    public function setWidthMaxPx($width)
    {
        $this->_widthMaxPx = $width;
    }

    public function getWidthMaxPx()
    {
        return $this->_widthMaxPx;
    }

    public function getWidthSVG($patternId)
    {
        return self::SIZES[$this->getValidPatternId($patternId)][0];
    }

    public function getHeightSVG($patternId)
    {
        return self::SIZES[$this->getValidPatternId($patternId)][1];
    }

    public function getWidthImage($patternId)
    {
        return self::SIZES[$this->getValidPatternId($patternId)][0] * $this->getZoom();
    }

    public function getHeightImage($patternId)
    {
        return self::SIZES[$this->getValidPatternId($patternId)][1] * $this->getZoom();
    }

    public function generateSVGImage($patternId)
    {
        $patternIdUsed = $this->getValidPatternId($patternId);
        return '@<svg viewBox="0 0 ' . $this->getWidthSVG($patternIdUsed) . ' ' . $this->getHeightSVG($patternIdUsed) . '" xmlns="http://www.w3.org/2000/svg">' .
            self::SVG_PATTERNS[$patternIdUsed] . '</svg>';
    }

    public function calculateRepeatX($patternId)
    {
        return intval(ceil($this->getWidthMaxPx() / $this->getWidthImage($this->getValidPatternId($patternId))));
    }

    public function calculateRepeatY($sampleHeight, $patternId)
    {
        return intval(ceil($sampleHeight / $this->getHeightImage($this->getValidPatternId($patternId))));
    }

    private function getValidPatternId($patternId)
    {
        if (key_exists($patternId, self::SVG_PATTERNS)) {
            return $patternId;
        } else {
            return 1; // "unknown pattern"
        }
    }
}